"Bancarios Profit" é uma extensão do chrome que melhora suas chances de profitar no csgo.net adicionando novas funções ao site.

Funcionalidades:
- Simulador de aberturas de caixas! Você pode simular uma abertura antes de usar seu saldo real;
- Usuários da extensão terão SEMPRE o cupom de bônus nos depósitos;
- Habilita um resumo de chances de profit em cada caixa do site;
- Habilita um link direto para os sorteios de quem usou o cupom ativo nos depósitos;
- Exibe os profits dos usuários da extensão em tempo real no csgo.net e leodobancarios.com;
